Scripts can run logic either when loaded or when triggered by an event. For example the script: print("hello from load time")
function on_event() print("hello from event time")
end Will print "hello from load time" when the script is loaded, and "hello from event time" when the script receives an event targeting the on_event callback with a receiver list including this script or entity. In order to trigger on_event you need to first define a label, then send an event containing the label: // define the label, you can define as many as you like here
callback_labels!(OnEvent => "on_event"); // trigger the event
fn send_event(mut writer: EventWriter<ScriptCallbackEvent>) { writer.send(ScriptCallbackEvent::new_for_all( OnEvent, vec![ScriptValue::Unit], ));
} Note the second argument is the payload we are sending with the event, in this case we are sending an empty payload.

