Let's say your language supports a Value type which can be returned to the script. And it has a Value::Function variant. The type on the Rust side would look something like this: pub enum Value { Function(Arc<Fn(&[Value]) -> Value>), // other variants
} This is fine, and can be integrated with BMS. Since an Fn function can be a closure capturing a DynamicScriptFunction. If there is no support for FnMut closures though, you might face issues in the implementation. Iterators in bevy_mod_scripting_functions for example use DynamicScriptFunctionMut which cannot work with Fn closures. Now let's imagine instead another language with a similar enum, supports this type instead: pub enum Value { Function(Arc<dyn Function>), // other variants
} pub trait Function { fn call(&self, args: Vec<Value>) -> Value; fn num_params() -> usize;
} This implies that to call this function, you need to be able to know the amount of arguments it expects at COMPILE time. This is not compatibile with dynamic functions, and would require a lot of code generation to make work with BMS. Languages with no support for dynamic functions are not compatible with BMS.
